INSERT INTO `SKILL` VALUES (1,'Visão do futuro','Capacidade de antecipar barreiras e tendências identificando oportunidade  mais criativas e benéficas para a organização ou para a adversidade.'),(2,'Comunicação','Capacidade de transmitir e expressar ideias, pensamentos , emoções e informações de forma clara e objetiva, de modo a garantir sua compreensão sem distorções ou ruídos.'),(3,'Gestão do tempo','Capacidade de gerenciar adequadamente a execução das tarefas , planejando e organizando recursos, em conformidade com o prazo acordado.'),(4,'Equilíbrio emocional','Qualidade no domínio das emoções e de adequação a resposta emocional a estímulos internos externos.'),(5,'Trabalho em equipe','Busca construir relacionamentos assertivos para com os outros, respeitando as necessidades e contribuições dos demais, levando os integrantes a alcançarem positivamente os resultados estabelecidos.'),(6,'Resiliência','Capacidade de lidar com problemas, superar obstáculos ou resistir a pressão de situações adversas dando condição para enfrentar e alcançar os objetivos esperados.');
